import React from 'react';
import ReactDOM from 'react-dom/client';
import logo from './logo.svg';
//import './css/App.css';
import './css/alt.css';

class App extends React.Component {
  render() {
    const status = 'Next Player: ';
    return(
      <div>
        <p>{status}</p>
        <div>
          {this.renderSquare(0)}
          {this.renderSquare(1)}
          {this.renderSquare(2)}
        </div>
        <div>
          {this.renderSquare(3)}
          {this.renderSquare(4)}
          {this.renderSquare(5)}
        </div>
        <div>
          {this.renderSquare(6)}
          {this.renderSquare(7)}
          {this.renderSquare(8)}
        </div>
      </div>
    );
  }
}

export default App;
